SELECT COUNT(DISTINCT(inclusion.id))
FROM ((SELECT p.id FROM patient p WHERE (p.resource ->> 'birthDate')::timestamp < '2005-10-01'::timestamp)
      INTERSECT
      (SELECT o.resource #>> '{subject,id}'
       FROM observation o,
            jsonb_array_elements(o.resource #> '{code,coding}') coding
       WHERE coding ->> 'system' = 'http://loinc.org'
         AND coding ->> 'code' IN ('26499', '751-8', '753-4')
         AND o.resource #>> '{value,Quantity,code}' = '10*3/uL'
         AND (o.resource #>> '{value,Quantity,value}')::decimal >= 1.5
         AND (o.resource #>> '{effective,dateTime}')::timestamp < '2023-10-01'::timestamp)
      INTERSECT
      (SELECT o.resource #>> '{subject,id}'
       FROM observation o,
            jsonb_array_elements(o.resource #> '{code,coding}') coding
       WHERE coding ->> 'system' = 'http://loinc.org'
         AND coding ->> 'code' IN ('26515-7', '49497-1', '778-1')
         AND o.resource #>> '{value,Quantity,code}' = 'K/uL'
         AND (o.resource #>> '{value,Quantity,value}')::decimal >= 100
         AND (o.resource #>> '{effective,dateTime}')::timestamp < '2023-10-01'::timestamp)) AS inclusion
WHERE inclusion.id NOT IN ((SELECT p.resource #>> '{subject,id}'
                            FROM "procedure" p,
